// Dependencies.
import React from 'react';

// Component 'AboutMe'.
function Projects() {
    return (
        // AboutMe Container.
        <>
            <div id="MyProjects">
                <div id="MyProjectsHeader" class="jumbotron text-center">
                    <h1 class="card-title display-3"><strong>&lt; My Projects &gt;</strong></h1>
                    <p class="lead card-text">
                        This is a short preview of each of my six most proud projects from school, work, and personal.<br />
                        You can cycle through the list by tapping the small blue circles at the bottom of the project<br />
                        cards or by swiping left or right on the screen. If you want to view more of my work, please<br />
                        visit my Github or LinkedIn for more information.
                    </p>

                    <a class="fa-lg p-4 m-2 li-ic hvr-grow"><i class="fab fa-linkedin-in text-white display-4"></i></a>
                    <a class="fa-lg p-4 m-2 tw-ic hvr-grow"><i class="fab fa-github text-white display-4"></i></a>
                </div>
                <div className="row">
                    <div className="col-md-12">
                        {/* <!-- Card --> */}
                        <div class="card project m-4">
                            {/* <!-- Card image --> */}
                            <img class="card-img-top" src="https://mdbootstrap.com/img/Photos/Others/images/43.jpg" alt="Card image cap" />
                            {/* <!-- Card content --> */}
                            <div class="card-body">
                                {/* <!-- Title --> */}
                                <h4 class="card-title"><a>Card title</a></h4>
                                {/* <!-- Text --> */}
                                <p class="card-text">Some quick example text to build on the card title and make up the bulk.</p>
                                {/* <!-- Button --> */}
                                <a href="#" class="btn btn-primary">Button</a>
                            </div>
                        </div>
                                                {/* <!-- Card --> */}
                                                <div class="card project m-4">
                            {/* <!-- Card image --> */}
                            <img class="card-img-top" src="https://mdbootstrap.com/img/Photos/Others/images/43.jpg" alt="Card image cap" />
                            {/* <!-- Card content --> */}
                            <div class="card-body">
                                {/* <!-- Title --> */}
                                <h4 class="card-title"><a>Card title</a></h4>
                                {/* <!-- Text --> */}
                                <p class="card-text">Some quick example text to build on the card title and make up the bulk.</p>
                                {/* <!-- Button --> */}
                                <a href="#" class="btn btn-primary">Button</a>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}
// Do export.
export default Projects;
